I have the output of a model that gives the output as a sequence of maps in the case of multiclass classification. I am trying to print the info of the map. 
However, I do not need the size of the map in advance. For more reference following is the code snippet: 
`
auto output_tensors = session.Run(Ort::RunOptions{ nullptr }, input_node_names.data(),
        &input_tensor, 1, output_node_names_.data(), 2);
    assert(output_tensors.size() == 2 && output_tensors.front().IsTensor());

    // Get pointer to output tensor float values
    int64_t* label = output_tensors.front().GetTensorMutableData<int64_t>();
   
    auto seq = output_tensors.back().GetCount();
    for (int i = 0; i < seq; ++i)
    {
        // Get the map at the given i
        auto proba = output_tensors.back().GetValue(i, allocator);

         // Fetch the key
        Ort::Value keys_ort = proba.GetValue(0, allocator);
        int64_t* keys_ret = keys_ort.GetTensorMutableData<int64_t>();

        // second fetch the values
        Ort::Value values_ort = proba.GetValue(1, allocator);
        float* values_ret = values_ort.GetTensorMutableData<float>();
        
        // I want thesize of the map so that I can iterate and print the map in a 
        // Key-Value pair.
    }
` 

Is there any API to get the size of the map or any other better way to get this done.
I want the output to be similar to the following:
`[{0: 1.0000001192092896, 1: 0.0, 2: 0.0}, {0: 1.0000001192092896, 1: 0.0, 2: 0.0}, {0: 0.0, 1: 1.0000001192092896, 2: 0.0}]`

**Describe the bug**
Used sklearn-onnx to convert pickle models to .onnx. The python onnxrun is working.
But I am trying to emulate same behavior with c++. 
I used Mnist as code reference but my output tensor is Sequence of Map<Int64,Tensor(Float)>.
```
 std::vector<int64_t>keys{0,0};
 std::vector<float> values{0.0f,0.0f};
 std::vector<int64_t> dims{2};
 auto allocator_info = Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeDefault);
 Ort::Value keys_tensor = Ort::Value::CreateTensor(allocator_info, keys.data(), keys.size()* sizeof(int64_t), dims.data(), dims.size()
    ,ONNX_TENSOR_ELEMENT_DATA_TYPE_INT64);
Ort::Value values_tensor = Ort::Value::CreateTensor(allocator_info, values.data(), values.size()* sizeof(float), dims.data(), dims.size(),ONNX_TENSOR_ELEMENT_DATA_TYPE_FLOAT);
 std::vector<Ort::Value> in;
 in.emplace_back(Ort::Value::CreateMap(keys_tensor, values_tensor));
output_tensor_= Ort::Value::CreateSequence(in);
size_t num_values = output_tensor_.GetCount(); // prints 1
session_.Run(Ort::RunOptions{nullptr}, input_names, &input_tensor_, 1, output_names, &output_tensor_, 1);
```

The names of nodes are rightly pointed to correct c str(I tried changing them to another output node then It threw "Trying to get a Tensor, but got: seq(map(int64,tensor(float))) ). 
The run times throws no errors but the keys & values vectors are not  getting updated by run time. The values should be probability score but I see only 0.0f & 0.0f



**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10. 
- ONNX Runtime installed from (source or binary): MS Build from source yesterday.
- ONNX Runtime version: MS Build from source yesterday.
- Python version:
- Visual Studio version (if applicable): 19.0
- GCC/Compiler version (if compiling from source): VS 19.0
- CUDA/cuDNN version: NA
- GPU model and memory: NA



**Expected behavior**
The run times throws no errors but the keys & values vectors are not  getting updated by run time. 
In python, this is how I receive the `output_probability [[{0: 0.39406856894493103, 1: 0.6059314608573914}]]`
The type also shows seq(map(int64,tensor(float))).  I expected keys vector to store{0,1} & values vector to store`{ 0.39406856894493103, 0.6059314608573914}.` The values should be probability score but I see only 0.0f & 0.0f for values and 0,0 for keys.

